import React,{Component} from 'react';
import {Button} from 'react-bootstrap';
import './CustomNav.css';
export default class Home extends Component{
render(){
    return(
            <div class="container">
           <div className="jumbotron" >
                <h1 className="cover-heading">Welcome To MSM School Management</h1>
                <p className="lead">
                Cover is a one-page template for building simple and beautiful home pages.<br></br>
                Download, edit the text, and add your own fullscreen background photo to make it your own.</p>
                <p className="lead">
                <Button  variant="light" class="btn btn-lg">Learn more</Button>
                </p>
           </div>
            </div>
    )
}
}
